string minWindow(string s, string t) {
	if(s.length()<t.length()) return "";

	map<char,int> t_map;
	map<char,int> w_map;
	for(char x: t){
		t_map[x]++;
	}
	int charsNeeded=t.length();
	int charsMatched=0;
	int minWindowLength=INT_MAX;
	int minWindowStart=0;
	int minWindowEnd=0;
	int j=-1;
	int s_length =s.length(); 
	for(int i=0;i<s_length;i++){

		while( (j< s_length) and (charsMatched<charsNeeded)){
			j++;
			w_map[s[j]]++;
			if(w_map[s[j]]<=t_map[s[j]]){
				charsMatched++;
			}
		} 
		if(charsMatched==charsNeeded){
			
			if(j-i+1<minWindowLength){
				minWindowLength=j-i+1;
				minWindowStart=i;
				minWindowEnd=j;
				//cout<<endl<<s.substr(i,minWindowLength);
			}
		}
		w_map[s[i]]--;
		if( w_map[s[i]] < t_map[s[i]] ){
			charsMatched--;
		}
	}
	return minWindowLength==INT_MAX?"":s.substr(minWindowStart,minWindowLength);
} 
